-- DROP DATABAE IF EXISTS contactosdb;
-- CREATE DATABASE IF NOT EXISTS contactosdb CHARACTER SET utf8 COLLATE utf8_spanish_ci;
-- USE contactosdb;

DROP TABLE IF EXISTS contactos;
CREATE TABLE IF NOT EXISTS contactos (
  id INTEGER NOT NULL PRIMARY KEY,
  alias VARCHAR(255) NOT NULL,
  apellidos VARCHAR(255) NOT NULL,
  nombre VARCHAR(255) NOT NULL,
  direccion VARCHAR(255) NOT NULL,
  poblacion VARCHAR(255) NOT NULL,
  telefono VARCHAR(255) NULL,
  movil VARCHAR(255) NULL,
  email VARCHAR(255) NULL,
  observaciones VARCHAR(255) NULL,
  sexo VARCHAR(255) NOT NULL,
  fechaNacimiento DATE NOT NULL,
  estadoCivil VARCHAR(255) NOT NULL,
  hijos INTEGER NULL,
  desempleado VARCHAR(1) NOT NULL,
  profesion VARCHAR(255) NULL,
  nivelAcademico VARCHAR(255) NULL,
  lenguaUsual VARCHAR(255) NOT NULL,
  ingresosMensuales DECIMAL(10,2)  NULL,
  ahorros DECIMAL(10,2) NULL,
  peso DECIMAL(10,2) NOT NULL,
  altura DECIMAL(10,2) NOT NULL,
  cabello VARCHAR(255) NOT NULL,
  ojos VARCHAR(255) NOT NULL,
  fumador VARCHAR(1) NOT NULL,
  salud VARCHAR(255) NOT NULL,
  aficion1 VARCHAR(255) NOT NULL,
  aficion2 VARCHAR(255) NOT NULL,
  caracteristica1 VARCHAR(255) NOT NULL,
  caracteristica2 VARCHAR(255) NOT NULL,
  valora1 VARCHAR(255) NOT NULL,
  valora2 VARCHAR(255) NOT NULL,
  fobias VARCHAR(255) NULL,
  sexualidad VARCHAR(255) NOT NULL,
  disponible VARCHAR(1) NOT NULL
);

